internal class S09C06P02SuffixArrayTest {

    lateinit var pmsa: PatternMatchingSuffixArray

    @BeforeEach
    fun setUp() {
        pmsa = PatternMatchingSuffixArray()
    }
    /**
     * Construct the Suffix Array of a String
     * Rosalind: https://rosalind.info/problems/ba9g/
     *
     */


    /**
     * Suffix Array Construction Problem: Construct the suffix array of a string.
     *
     * Input: A string Text.
     *
     * Output: SuffixArray(Text), as a space-separated collection of integers.
     */

    @Test
    @DisplayName("Suffix Array Sample Test")
    fun suffixArraySampleTest() {

        val inputString = "AACGATAGCGGTAGA$"

        val result = pmsa.assembleSuffixArray(inputString)

        val stringResult = result.joinToString(" ")

        val expectedResult = "15 14 0 1 12 6 4 2 8 13 3 7 9 10 11 5"
        assertEquals(expectedResult, stringResult)


    }

    // see: https://rosalind.info/problems/ba9g/
    @Test
    @DisplayName("Suffix Array Example Test")
    fun suffixArrayExampleest() {

        val inputString = "panamabananas$"

        val result = pmsa.assembleSuffixArray(inputString)

        val stringResult = result.joinToString(" ")

        val expectedResult = "13 5 3 1 7 9 11 6 4 2 8 10 0 12"
        assertEquals(expectedResult, stringResult)


    }

