    fun partialSuffixArraySampleTest() {
        val inputString = "panamabananas$"

        val result = pmsa.assemblePartialArray(inputString, 5)

        val stringResult = result.joinToString("\n") { "${it.first} ${it.second}" }
        //println(stringResult)

        val expectedResult = """
            1 5
            11 10
            12 0
        """.trimIndent()

        assertEquals(expectedResult, stringResult)

    }

    // https://rosalind.info/problems/ba9h/
    /**
     * Multiple Pattern Matching with the Suffix Array

    Given: A string Text and a collection of strings Patterns.

    Return: All starting positions in Text where a string from Patterns appears as a substring.
     */

    @Test
    @DisplayName("Pattern Matching with the Suffix Array Sample test")
    fun patternMatchingSuffixArraySampleTest() {
        val inputString = "AATCGGGTTCAATCGGGGT"
        val patterns = """
            ATCG
            GGGT
        """.trimIndent().lines().toList()

        val result = pmsa.patternMatchSuffixArray(inputString, patterns)

        //println(result.sorted().joinToString(" "))

        val expectedResult = "1 4 11 15"
        assertEquals(expectedResult, result.sorted().joinToString(" "))
    }

    @Test
    @DisplayName("Pattern Matching with the Suffix Array Extra Dataset test")
